import React from "react";

class Country extends React.Component {
    render () {
        return (
            <div>
                    <div class="w3-container w3-xlarge w3-green w3-shadow w3-hide-small">
                        <div class="w3-center"><h1 style="margin-top:30px;margin-bottom:20px;">Choose a country recipe page</h1></div>
                    </div>

                    <div class="w3-container w3-xlarge w3-green w3-shadow w3-hide-large">
                     <div class="w3-center"><h1 style="margin-top:20px;font-size: 20px;">Choose a country recipe page</h1></div>
                    </div>
            </div> 
        ); 
    }
}

export default Country;
